import React, {useCallback, useEffect, useState} from 'react';
import Container from "../../Components/Container/Container";
import {useHttp} from "../../Hooks/http.hook";

const RopesInStock = () => {
    const {loading, error, request} = useHttp();
    const [ropes, setRopes] = useState(null);

    const fetchedRopes = useCallback(async () => {
      try {
          const fetched = await request('/ropes/getAllRopes', 'GET');
          setRopes(fetched);
          console.log(fetched);
      }  catch (e) {
          console.log(e);
      }
    }, [request])

    useEffect(() => {
        fetchedRopes();
    }, [fetchedRopes])

    return (
        <Container>
            <div>
                Ropes in stock page
            </div>
        </Container>
    );
};

export default RopesInStock;
